import React from "react";
import Foto from "../imagenes/FotoPerfil.jpg";
import FlechaAtras from "../imagenes/FlechaAtras.png";
import Info from "../imagenes/Info.png";
import Cookies from "universal-cookie";

const cookies = new Cookies();

export default class ResultadosAct extends React.Component {
  render() {
    var X;
    var Y;
    var Desc;
    var Prof;
    () => {
      var R = cookies.get("Resultado");
      if (R == "A") {
        X = Test.resultadoA.descripcion;
        Y = Test.resultadoA.profesiones;
      } else if (R == "B") {
        X = Test.resultadoB.descripcion;
        Y = Test.resultadoB.profesiones;
      } else if (R == "C") {
        X = Test.resultadoC.descripcion;
        Y = Test.resultadoC.profesiones;
      } else if (R == "D") {
        X = Test.resultadoD.descripcion;
        Y = Test.resultadoD.profesiones;
      } else if (R == "E") {
        X = Test.resultadoE.descripcion;
        Y = Test.resultadoE.profesiones;
      }
    };
    Desc = X;
    Prof = Y;
    return (
      <div className="container-fluid">
        <div className="row">
          <div className="col my-5 py-5">
            <nav className="navbar p-0 w-100 bg-transparent">
              <a href="./Cuenta">
                <img src={FlechaAtras} width="38" alt="Atrás" />
              </a>
              <h5 className="text-center text-white py-2">
                Test {cookies.get("id_test")}
              </h5>
              <img src={Info} width="35" alt="Info" />
            </nav>
            <div className="d-flex justify-content-center">
              <img
                src={Foto}
                alt="Foto de Perfil"
                className="rounded-circle"
                width="150"
              />
            </div>
            <h5 className="text-center text-white mb-5">
              {cookies.get("nombre") + " " + cookies.get("apellido")}
            </h5>
            <div className="container">
              <div className="text-white p-3 border rounded">
                <nav aria-label="Page navigation example">
                  <ul className="pagination">
                    <li className="w-100 text-center page-item active">
                      <a
                        className="page-link"
                        data-toggle="collapse"
                        data-target=".multi-collapse"
                        aria-expanded="true"
                        aria-controls="multiCollapseExample1 multiCollapseExample2"
                      >
                        Descriptivo
                      </a>
                    </li>
                    <li className="w-100 text-center page-item">
                      <a
                        className="page-link"
                        data-toggle="collapse"
                        data-target=".multi-collapse"
                        aria-expanded="false"
                        aria-controls="multiCollapseExample1 multiCollapseExample2"
                      >
                        Profesional
                      </a>
                    </li>
                  </ul>
                </nav>
                <div className="collapse show multi-collapse">{Desc}</div>
                <div className="collapse multi-collapse">{Prof}:</div>
              </div>
              <div className="d-flex justify-content-end">
                <a
                  href="./Cuenta"
                  type="submit"
                  className="btn btn-sm btn-success m-1"
                >
                  Terminar
                </a>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
